INSERT INTO `brand_brand` VALUES (1,'Redtape','','Red tape shoes','India\'s trusted leading Fashion & Lifestyle brand with over 390+ opulent stores across PAN India.\nLeading with our experience and expertise for 26 years and counting.',1996,31,'IND',1,10,7,'BOTH','',0,'','https://redtape.com/','+91 7836850000','customercare@redtapeindia.com','https://www.instagram.com/redtapeindia/','https://www.facebook.com/RedTape-143362402810/','','','VAL',1,0,0,0,0,'EVA, mesh','','',0,0.0,0.0,0,'2023-07-11 16:42:01.482261',1),(2,'Liberty Shoes','','Footwear online from the most trusted brand','We, at Liberty Shoes have been fashioning footwear, for well over 50 years now, for the style-conscious people around the globe.',1954,200,'IND',1,7,7,'BOTH','EXCH',0,'','https://www.libertyshoesonline.com/','+91 9354111126','lsocare@libertyshoes.com','https://www.instagram.com/libertyshoesltd/','https://www.facebook.com/libertyshoes/','','','VAL',1,0,0,0,0,'Poly urethane(PU), EVA, leather','','',0,0.0,0.0,0,'2023-07-11 16:42:45.509490',1),(3,'Red Chief','','Comfort walk- for men and women','Leayan Global Pvt. Ltd, the fast growing part of RSPL, is a respected name in leather industry since 1995. It’s an assemblage of potential manufacturing units with an unbeaten experience of 16 years. RSPL Limited started its primary business with a single production unit with its own FMCG soap Brand- GHARI in the year 1988. With its innovative and hardworking attempts, GHARI became a leading FMCG brand in India.',1997,2000,'IND',1,7,15,'BOTH','EXCH',0,'','https://www.redchief.in/','+91 9794352555','retailcare@redchief.co.in','https://www.instagram.com/redchiefofficial/','https://www.facebook.com/redchiefofficial/','','','VAL',1,0,0,0,0,'PVC, silicone','','',0,0.0,0.0,0,'2023-07-11 16:42:46.759114',1),(4,'Crocs','','UNKNOWN','In 2002, we introduced the world to one of the most unique brands that anyone had\never seen: we were different and it made some people uncomfortable.\n\nNow, hundreds of millions of shoes later, we make the world comfortable.',2002,6000,'IND',1,5,7,'PRE','NONE',0,'','https://www.crocs.in/','022-68353126','support-in@crocs.in','https://www.instagram.com/crocsindia/','https://www.facebook.com/crocs.india/','','','VAL',1,0,0,0,0,'crosslite tm','','',0,0.0,0.0,0,'2023-07-11 16:42:47.456541',1),(5,'Lakhani Footwear','','UNKNOWN','Lakhani Footwear produces a wide range in footwear including cemented, vulcanized, injected, leather and slippers. To meet the varied needs of its customers, Lakhani Footwear has setup state-of-the-art plants in Faridabad (Haryana), Dhar(MP) and Haridwar (Uttaranchal) to produce Sports Shoes, Leather Shoes, Canvas Shoes and EVA Slippers.',1996,5000,'IND',1,5,7,'BOTH','',0,'','https://www.lakhanifootwear.com/','129-4265555','info@lakhaniarmaan.com','https://www.instagram.com/lakhani_footwear/','https://www.facebook.com/LakhaniFootwearOfficial/','','','VAL',1,0,0,0,0,'PU, PVC','','',0,0.0,0.0,0,'2023-07-11 16:42:48.343089',1),(6,'Paragon Footwear','','footwear for men and women','As a brand that sells all over the country, Paragon needs little or no introduction in the Indian sub-continent. While rubber footwear continues to be its leading product, the Paragon brand name brings its longstanding assurance of quality and durability to a full range of other footwear products made of Poly-Urethane (PU), Poly Vinyl Chloride (PVC), Ethylene-Vinyl Acetate (EVA) and Thermo Plastic Rubber (TPR) soles too. Paragon also has an in-house footwear design team dedicated to creating new designs and models to keep up with market demand.',1975,101,'IND',1,12,3,'BOTH','',0,'','https://www.paragonfootwear.com/','1800 425 55552','esupport@paragonfootwear.com','https://www.instagram.com/paragonfootwear/','https://www.facebook.com/Paragonfootwear/','','','VAL',1,0,0,0,0,'rubber, canvas, PVC','','',0,0.0,0.0,0,'2023-07-11 16:42:52.009514',1),(7,'Campus','','Footwear for all your needs','Campus is India’s largest sports and athleisure footwear brand. \'Campus\' is the largest sports and athleisure brand in India terms of value and volume in Fiscal 2021. Campus was introduced in 2005 as a lifestyle-oriented sports and athleisure brand that offers a diverse product portfolio for the entire family. The brand offers multiple choices across styles, color palettes, price points and an attractive product value proposition.',2006,300,'IND',1,7,15,'BOTH','',0,'','https://www.campusshoes.com/','011 43272500','customercare@campusshoes.com','https://www.instagram.com/campusshoes/','https://www.facebook.com/CampusShoes/','','','VAL',1,0,0,0,0,'rubber, mesh fabric','','',0,0.0,0.0,0,'2023-07-11 16:42:53.537106',1),(8,'Relaxo','','Buy footwear online','Incorporated in 1984, Relaxo is the largest footwear manufacturer in India, serving the nation since four decades, and is today ranked among the top 500 Most Valuable Companies.\nA Fortune 500 (India) company, synonymous with quality products & affordable prices,it manufactures slippers, sandals and sports & casual shoes.',1976,8000,'IND',1,10,15,'BOTH','',0,'','https://www.relaxofootwear.com/','1800 108 6001','thebrandscanner@gmail.com','https://www.instagram.com/sparxgoforit/','https://www.facebook.com/relaxofootwears/','','','VAL',1,0,0,0,0,'rubber, EVA','','',0,0.0,0.0,0,'2023-07-11 16:42:55.318962',1),(9,'VKC Pride','','Celebrate hard work','UNKNOWN',1984,786,'IND',1,5,3,'BOTH','',0,'','https://vkcpride.com/','UNKNOWN','ecomm@vkcgroup.net','https://www.instagram.com/officialvkc/','https://www.facebook.com/officialVKC/','','','VAL',1,0,0,0,0,'synthetic leather, PU','','',0,0.0,0.0,0,'2023-07-11 16:42:55.978460',1),(10,'Mirza','','Top leather footwear manufacturer in india','In 1979, Mirza Tanners Private Ltd was founded by Mr. Irshad Mirza and Mr. Rashid Ahmed Mirza as a small tannery unit with a big vision for the leather industry. Since then, Mirza International Limited has been committed to manufacturing high-quality leather and footwear.',1979,3000,'IND',1,7,7,'BOTH