f6cc19a72876c89d5e542522e3bf9d2.jpg','',0),(53,'MR','John Bissell','','',0),(54,'MR','Malik Tejani','','Metro Brands started with a vision, a vision to create the best footwear destination in India. He started as a humble salesman in a store at Grant Road. When the owner emigrated at the time of the partition, he took a loan and bought the store.',0),(55,'MR','Satya Prasad Roy Burman','uploads/2023/07/11/852d39e03158efb48b62770ddf7bd942.jpg','',0),(56,'MR','Satyajith Mittal','','',0),(57,'MR','Joseph William Foster','uploads/2023/07/11/d5ec5a232765a954cedd51d876f2dce3.jpg','',0),(58,'MR','Sofi Khwaja','uploads/2023/07/11/63bc829d46392b9a51b2c89abede28b0.jpg','Sofi Khwaja, the CEO, is a woman and a POC. This puts us in a unique position to truly represent our diverse community of outdoor enthusiasts.',0),(59,'MR','Shivam Mishra','','',0),(60,'MR','Johannes Quodt','uploads/2023/07/11/8e452e91ddab0e4f4910954ac70852b2.jpg','',0),(61,'MR','Johann Adam Birkenstock','','',0),(62,'MR','Michael Greenberg','uploads/2023/07/11/040dfea94468f7766beee9ca40824cd6.jpg','',0),(63,'MR','Moiz Ali','uploads/2023/07/11/24176f2a4b31f079c4419413b48f3565.jpg','',0),(64,'MR','Tomas Bata','uploads/2023/07/11/a3bfb7765ff7195e829a33f4e70cdcd4.jpg','',0),(65,'MR','Rafique Malik\'s','','',0),(66,'MS','Laksheeta Govil','uploads/2023/07/11/c969b72f915fd960a41d0bc6a3f1d9d5.jpg','',0),(67,'MR','Kenneth Cole','uploads/2023/07/11/b1ed25cb8de060e57d84819219850958.jpg','',0),(68,'MR','Aldo Bensadoun','uploads/2023/07/11/f3b169ffaa4009cefbe92bb9d94c235f.jpg','Aldo Bensadoun, celebrated Canadian business leader and philanthropist, is the founder of the ALDO Group. A privately held, Montreal-based company established in 1972, the ALDO Group is internationally renowned as a leader in footwear brands and retail concepts.',0),(69,'MR','Ajani Ismail','uploads/2023/07/11/6ed02f01595ceffe184702b8b46522b2.jpg','',0),(70,'MR','Arthur Ratz Kaufman','','',0),(71,'MR','Steve Adler','','',0),(72,'MS','Divya Manjari','','',0),(73,'MS','Harpreet Randhawa','','',0),(74,'MS','Sunakshi Jain','uploads/2023/07/11/7e0d47c6439952243186cf4b48729396.jpg','',0),(75,'MR','Anshul Sood','','',0),(76,'MR','Steve Madden','uploads/2023/07/11/f017251997398cec482daedaa32445f2.jpg','A man who wears many hats – and shoes, Steve Madden cannot be described in one word. He is an entrepreneur, an award-winning designer, a business titan, and a family man. The eponymous shoe designer is also the subject of the documentary film, MADDMAN: The Steve Madden Story on Netflix. A movie that delves into the man who built a booming brand and nearly lost it to “The Wolf of Wall Street,” only to rebound with a global empire. He’s endured failures and of course successes without forgetting his humble beginnings or his core consumer, resulting in millions of adoring fans worldwide. Considered the fashion footwear mogul of the 21st century, Madden has an innate sense of what’s hot, what’s next, what’s exciting and more importantly, how this will translate to the customer. Inspired by rock and roll, fused with a jolt of sex appeal and urban edge, Madden creates shoes that are innovative, fun, sometimes wild and always spot-on-chic.',0),(77,'MR','Asif Merchant','','',0),(78,'MR','Gautam Sinha','uploads/2023/07/11/e03e8c3f18a4c5af1133d7ec8de797b4.jpg','Behind the brand is the visionary creative force of Gautam Sinha, the Founder and Creative Director of Nappa Dori. Renowned for his creative process that has propelled Nappa Dori from a single store in HauzKhas Village in Delhi to over 20 countries.',0),(79,'MS','Suchi Mukherjee','uploads/2023/07/11/0eee5a3905c2fbea84fcac01bf59e7d5.jpg','',0),(80,'MS','Nina Dutta','','',0),(81,'MR','Clark Matis','','',0),(82,'MR','Manav Shah','uploads/2023/07/11/65fd9dcd4fcc6fda17ece79a9f644cb2.jpg','',0),(83,'MR','Abhishek Sharma','uploads/2023/07/11/e75a6d0f600d7277d6912da9e67cf248.jpg','',0),(84,'MR','Naman Shah','uploads/2023/07/11/9338eaf919873958b9ff7341da0ada2d.jpg','',0),(85,'MR','A